import 'dart:convert';
/// status : true
/// response : [{"id":1,"title":"إشعار الخصوصية","description":"<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>يصف إشعار الخصوصية هذا كيف شركة التنافسية&nbsp;</span><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>المالية&nbsp;</span><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تجمع البيانات الشخصية وكيفية معالجتها واستخدامها وحمايتها داخل المملكة العربية السعودية.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تعريفات:</span></strong></p>\r\n<ul style=\"list-style-type: undefined;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>في إشعار الخصوصية هذا، ما لم يقتضِ السياق خلاف ذلك، إن المصطلحات التالية المشار إليها لها المعاني التالية</span><span dir=\"LTR\" style=\"line-height:107%;font-size:16px;\">:</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>البيانات الشخصية</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>: تعني البيانات التي قد تؤدي إلى تحديد هوية الشخص، بشكل مباشر أو غير مباشر، بما في ذلك على سبيل المثال لا الحصر: الاسم الأول والاسم الأخير أو العائلة ورقم الهوية الوطنية السعودية والعناوين ورقم الهاتف ورقم الحساب المصرفي ورقم البطاقة الائتمانية.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>البيانات الشخصية التي نجمعها:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تختلف البيانات التي نجمعها بناءً على الغرض من استخدامها. ومع ذلك، فيما يلي أمثلة على البيانات التي نجمعها:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>البيانات التي يتم جمعها من خلال نماذج الطلبات أو الاستبيانات أو غيرها من الوثائق أو الاتصالات. على سبيل المثال لا الحصر الاسم الكامل وتاريخ الميلاد وأرقام الهوية.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>بيانات عن معاملاتك ومنتجاتك معنا، مثل نشاط الحساب واستخدام المنتجات.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>البيانات التي يتم جمعها من خلال استخدامك لخدماتنا أو مواقعنا الإلكترونية أو تطبيقات الهواتف المحمولة (مثل ملفات تعريف الارتباط).</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>البيانات التي يتم تبادلها أثناء تواصلنا معك، مثل طلبات خدمة العملاء والمرئيات التي تصلنا منك إما من خلال مواقعنا الإلكترونية أو تطبيقات الهاتف المحمول أو حسابات وسائل التواصل الاجتماعي أو أي قنوات نستخدمها للتواصل مع العملاء.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>الأساس القانوني وأغراض جمع واستخدام بياناتك الشخصية:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نقوم بجمع واستخدام البيانات وفقاً لما هو متطلب بناء على طبيعة الخدمات والأعمال. في معظم الحالات، يتضمن أساسنا القانوني وأغراضنا، على سبيل المثال لا الحصر:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>الامتثال لأية التزامات ومتطلبات صادرة عن الجهات القانونية والتنظيمية داخل المملكة العربية السعودية.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>السماح لنا بتقديم المنتجات أو الخدمات.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>لحمايتك من الاحتيال عن طريق إجراء عمليات التحقق من الهوية والائتمان أو التحقق من عدم وجود تعارض.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>تحسين منتجاتنا وخدماتنا وتجربتك المقدمة عبر قنواتنا.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>فهم احتياجاتك كعميل وأهليتك للمنتجات والخدمات.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>الترويج لمنتجات وخدمات استثمارية ومالية جديدة قد تهمك.</span></li>\r\n</ul>\r\n<p><strong><span dir=\"RTL\" style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'><br>&nbsp;</span></strong></p>\r\n<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span dir=\"RTL\" style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>كيف يتم جمع بياناتك الشخصية:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>هناك العديد من نقاط الاتصال التي تساعدنا في جمع بياناتك، وبعض الأمثلة:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>عند انشاء العلاقة والاستفادة من الخدمة</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;- عندما تستخدم خدماتنا وتصبح عميلاً وتستفيد من منتجاتنا.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تبادل المعلومات</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;- عند إكمال نموذج ورفعه على موقعنا الإلكتروني أو تطبيقات الهاتف المحمول أو البريد الإلكتروني أو منشورات وسائل التواصل الاجتماعي أو عبر الاتصال بمركز العملاء أو المشاركة في الحملات الترويجية.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>التفاعل (وسائل التواصل الاجتماعي)</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>&nbsp;- أي منشورات أو تفاعل أو تواصل تجريها معنا بشكل مباشر على قنوات التواصل الاجتماعي.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نمط التصفح</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;- بيانات حول كيفية استكشافك لموقعنا على الانترنت، وتوقيت زيارتك، وأنواع متصفح الإنترنت، وكيف تمت إحالتك إلى موقعنا.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>الاستطلاعات</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>&nbsp;- استطلاعات الويب عبر الإنترنت التي تمكننا من جمع الآراء بشأن المواضيع. مثل، ما يعجبك وما لا يعجبك بشأن شكل ومظهر موقعنا الإلكتروني وتطبيقات الأجهزة المحمولة. ملاحظاتك القيمة تمكننا من تحسين جودة التجربة التي نقدمها لك كمنظمة.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>منك شخصياً أو من وكيلك المعتمد أومن ممثلك القانوني.&nbsp;</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>في الحالات المقبولة قانونياً، من أطراف ثالثة ومصادر عامة. وهذا يشمل الجهات الحكومية وشركات ووكالات المعلومات الائتمانية.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تخزين بياناتك الشخصية:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>ستكون بياناتك الشخصية:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>محتفظ بها طالما كان ذلك ضروريًا لتحقيق الغرض الذي تم جمعها من أجله</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>محتفظ بها داخل المملكة العربية السعودية</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>محتفظ بها لتلبية أي متطلبات قانونية وتنظيمية.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>حماية بياناتك الشخصية</span></strong><strong><span dir=\"LTR\" style=\"font-size:16px;line-height:107%;\">:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نحن نضمن حماية بياناتك بشكل مناسب من خلال استخدام الإجراءات والاحتياطات الأمنية المادية والتقنية والإدارية والإجرائية اللازمة لمنع الوصول غير المصرح به أو الجمع أو الاستخدام أو الكشف أو النسخ أو التعديل أو التخلص منها. نحمي بياناتك بطريقة تتوافق مع أنظمة ولوائح حماية البيانات ذات العلاقة السارية بها في المملكة العربية السعودية. ومع ذلك، فإن الإنترنت ليس آمنًا بشكل كامل.</span></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>الإفصاح عن بياناتك الشخصية:</span></strong></p>\r\n<ul style=\"list-style-type: undefined;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:150%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>قد نشارك بيناتك مع أي من الأطراف المذكورة أدناه</span><span style='line-height:150%;font-family:\"Arial\",\"sans-serif\";'>:</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>أي محكمة أو أي جهة حكومية أو تنظيمية للامتثال لأي التزامات ومتطلبات صادرة عن جهات قانونية وتنظيمية داخل المملكة العربية السعودية</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>أي وكيل تحصيل ديون أو جهة مرخصة بتقديم خدمة المعلومات الائتمانية أو شركة تأمين.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>قد يتم التواصل معك و/أو إرسال إشعارات إليك عبر قنوات مختلفة مثل الرسائل القصيرة (</span><span dir=\"LTR\" style=\"line-height:107%;font-family:Arial;font-size:16px;\">SMS</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>) و/أو البريد الإلكتروني و/أو الهاتف فيما يتعلق بمنتجاتنا وخدماتنا.</span></li>\r\n</ul>\r\n<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span dir=\"RTL\" style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>التغييرات على إشعار الخصوصية</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نحتفظ بالحق في تعديل إشعار الخصوصية هذا في أي وقت. يشير تاريخ نفاذ إشعار الخصوصية، كما هو مذكور أدناه، إلى أحدث تاريخ تمت فيه مراجعة إشعار الخصوصية هذا أو تعديله. يتيح لك التحقق من تاريخ النفاذ أدناه تحديد ما إذا كانت هناك تغييرات منذ آخر مرة قمت فيها بمراجعة إشعار الخصوصية. لذلك، ننصحك بالتحقق بشكل دوري على إشعار الخصوصية هذا لضمان اطلاعك على النسخة المحدثة.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>استخدام ملفات تعريف الارتباط</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>من أجل تحسين تجربة عملائنا، تستخدم مواقعنا الإلكترونية تقنية قياسية تسمى &quot;ملفات تعريف الارتباط&quot; لجمع معلومات حول كيفية استخدام مواقعنا الإلكترونية، والتي قد تتضمن بياناتك. يعد استخدام ملفات تعريف الارتباط أمرًا ضروريًا لتشغيل مواقعنا الإلكترونية.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>اتصل بنا</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>في حالة وجود أي أسئلة، يمكنك التواصل معنا من خلال أي من فروعنا، والبريد الإلكتروني، والمحادثة الفورية، ووسائل التواصل الاجتماعي أو من خلال موقعنا الإلكتروني وتطبيق الهاتف المحمول.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تاريخ النفاذ</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تم تعديل هذا الإشعار في ديسمبر&nbsp;</span><span dir=\"LTR\" style=\"font-size:16px;line-height:107%;\">.2022</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>إخلاء مسئولية</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>لا يهدف إشعار الخصوصية هذا إلى إنشاء أي حقوق تعاقدية من أي نوع أو أي حقوق قانونية أخرى، أو ينشئ أي التزامات علينا فيما يتعلق بأي طرف آخر أو نيابة عن أي طرف. عندما تقوم بتسجيل الدخول إلى مواقع الانترنت الخاصة بأي طرف ثالث، لن يسري إشعار الخصوصية هذا. إضافة إلى ذلك، نحن لسنا مسؤولين عن محتوى مواقع الويب الخاصة بأي طرف ثالث ولا نمثل أي طرف ثالث. لذلك، نوصيك بمراجعة سياسة الخصوصية والأمان لكل رابط تقوم بتسجيل الدخول إليه.</span></p>","type":3,"status":1,"position":1},null]

VisitorModel visitorModelFromJson(String str) => VisitorModel.fromJson(json.decode(str));
String visitorModelToJson(VisitorModel data) => json.encode(data.toJson());
class VisitorModel {
  VisitorModel({
      bool? status, 
      List<Response>? response,}){
    _status = status;
    _response = response;
}

  VisitorModel.fromJson(dynamic json) {
    _status = json['status'];
    if (json['response'] != null) {
      _response = [];
      json['response'].forEach((v) {
        _response?.add(Response.fromJson(v));
      });
    }
  }
  bool? _status;
  List<Response>? _response;
VisitorModel copyWith({  bool? status,
  List<Response>? response,
}) => VisitorModel(  status: status ?? _status,
  response: response ?? _response,
);
  bool? get status => _status;
  List<Response>? get response => _response;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    if (_response != null) {
      map['response'] = _response?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

/// id : 1
/// title : "إشعار الخصوصية"
/// description : "<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>يصف إشعار الخصوصية هذا كيف شركة التنافسية&nbsp;</span><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>المالية&nbsp;</span><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تجمع البيانات الشخصية وكيفية معالجتها واستخدامها وحمايتها داخل المملكة العربية السعودية.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تعريفات:</span></strong></p>\r\n<ul style=\"list-style-type: undefined;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>في إشعار الخصوصية هذا، ما لم يقتضِ السياق خلاف ذلك، إن المصطلحات التالية المشار إليها لها المعاني التالية</span><span dir=\"LTR\" style=\"line-height:107%;font-size:16px;\">:</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>البيانات الشخصية</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>: تعني البيانات التي قد تؤدي إلى تحديد هوية الشخص، بشكل مباشر أو غير مباشر، بما في ذلك على سبيل المثال لا الحصر: الاسم الأول والاسم الأخير أو العائلة ورقم الهوية الوطنية السعودية والعناوين ورقم الهاتف ورقم الحساب المصرفي ورقم البطاقة الائتمانية.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>البيانات الشخصية التي نجمعها:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تختلف البيانات التي نجمعها بناءً على الغرض من استخدامها. ومع ذلك، فيما يلي أمثلة على البيانات التي نجمعها:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>البيانات التي يتم جمعها من خلال نماذج الطلبات أو الاستبيانات أو غيرها من الوثائق أو الاتصالات. على سبيل المثال لا الحصر الاسم الكامل وتاريخ الميلاد وأرقام الهوية.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>بيانات عن معاملاتك ومنتجاتك معنا، مثل نشاط الحساب واستخدام المنتجات.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>البيانات التي يتم جمعها من خلال استخدامك لخدماتنا أو مواقعنا الإلكترونية أو تطبيقات الهواتف المحمولة (مثل ملفات تعريف الارتباط).</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>البيانات التي يتم تبادلها أثناء تواصلنا معك، مثل طلبات خدمة العملاء والمرئيات التي تصلنا منك إما من خلال مواقعنا الإلكترونية أو تطبيقات الهاتف المحمول أو حسابات وسائل التواصل الاجتماعي أو أي قنوات نستخدمها للتواصل مع العملاء.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>الأساس القانوني وأغراض جمع واستخدام بياناتك الشخصية:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نقوم بجمع واستخدام البيانات وفقاً لما هو متطلب بناء على طبيعة الخدمات والأعمال. في معظم الحالات، يتضمن أساسنا القانوني وأغراضنا، على سبيل المثال لا الحصر:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>الامتثال لأية التزامات ومتطلبات صادرة عن الجهات القانونية والتنظيمية داخل المملكة العربية السعودية.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>السماح لنا بتقديم المنتجات أو الخدمات.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>لحمايتك من الاحتيال عن طريق إجراء عمليات التحقق من الهوية والائتمان أو التحقق من عدم وجود تعارض.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>تحسين منتجاتنا وخدماتنا وتجربتك المقدمة عبر قنواتنا.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>فهم احتياجاتك كعميل وأهليتك للمنتجات والخدمات.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>الترويج لمنتجات وخدمات استثمارية ومالية جديدة قد تهمك.</span></li>\r\n</ul>\r\n<p><strong><span dir=\"RTL\" style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'><br>&nbsp;</span></strong></p>\r\n<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span dir=\"RTL\" style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>كيف يتم جمع بياناتك الشخصية:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>هناك العديد من نقاط الاتصال التي تساعدنا في جمع بياناتك، وبعض الأمثلة:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>عند انشاء العلاقة والاستفادة من الخدمة</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;- عندما تستخدم خدماتنا وتصبح عميلاً وتستفيد من منتجاتنا.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تبادل المعلومات</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;- عند إكمال نموذج ورفعه على موقعنا الإلكتروني أو تطبيقات الهاتف المحمول أو البريد الإلكتروني أو منشورات وسائل التواصل الاجتماعي أو عبر الاتصال بمركز العملاء أو المشاركة في الحملات الترويجية.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>التفاعل (وسائل التواصل الاجتماعي)</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>&nbsp;- أي منشورات أو تفاعل أو تواصل تجريها معنا بشكل مباشر على قنوات التواصل الاجتماعي.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نمط التصفح</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;- بيانات حول كيفية استكشافك لموقعنا على الانترنت، وتوقيت زيارتك، وأنواع متصفح الإنترنت، وكيف تمت إحالتك إلى موقعنا.</span></li>\r\n    <li><strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>الاستطلاعات</span></strong><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>&nbsp;- استطلاعات الويب عبر الإنترنت التي تمكننا من جمع الآراء بشأن المواضيع. مثل، ما يعجبك وما لا يعجبك بشأن شكل ومظهر موقعنا الإلكتروني وتطبيقات الأجهزة المحمولة. ملاحظاتك القيمة تمكننا من تحسين جودة التجربة التي نقدمها لك كمنظمة.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>منك شخصياً أو من وكيلك المعتمد أومن ممثلك القانوني.&nbsp;</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>في الحالات المقبولة قانونياً، من أطراف ثالثة ومصادر عامة. وهذا يشمل الجهات الحكومية وشركات ووكالات المعلومات الائتمانية.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تخزين بياناتك الشخصية:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>ستكون بياناتك الشخصية:</span></p>\r\n<ul style=\"list-style-type: disc;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>محتفظ بها طالما كان ذلك ضروريًا لتحقيق الغرض الذي تم جمعها من أجله</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>محتفظ بها داخل المملكة العربية السعودية</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>محتفظ بها لتلبية أي متطلبات قانونية وتنظيمية.</span></li>\r\n</ul>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>حماية بياناتك الشخصية</span></strong><strong><span dir=\"LTR\" style=\"font-size:16px;line-height:107%;\">:</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نحن نضمن حماية بياناتك بشكل مناسب من خلال استخدام الإجراءات والاحتياطات الأمنية المادية والتقنية والإدارية والإجرائية اللازمة لمنع الوصول غير المصرح به أو الجمع أو الاستخدام أو الكشف أو النسخ أو التعديل أو التخلص منها. نحمي بياناتك بطريقة تتوافق مع أنظمة ولوائح حماية البيانات ذات العلاقة السارية بها في المملكة العربية السعودية. ومع ذلك، فإن الإنترنت ليس آمنًا بشكل كامل.</span></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>الإفصاح عن بياناتك الشخصية:</span></strong></p>\r\n<ul style=\"list-style-type: undefined;margin-left:0cmundefined;\">\r\n    <li><span style='line-height:150%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>قد نشارك بيناتك مع أي من الأطراف المذكورة أدناه</span><span style='line-height:150%;font-family:\"Arial\",\"sans-serif\";'>:</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>أي محكمة أو أي جهة حكومية أو تنظيمية للامتثال لأي التزامات ومتطلبات صادرة عن جهات قانونية وتنظيمية داخل المملكة العربية السعودية</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";'>.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>أي وكيل تحصيل ديون أو جهة مرخصة بتقديم خدمة المعلومات الائتمانية أو شركة تأمين.</span></li>\r\n    <li><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>قد يتم التواصل معك و/أو إرسال إشعارات إليك عبر قنوات مختلفة مثل الرسائل القصيرة (</span><span dir=\"LTR\" style=\"line-height:107%;font-family:Arial;font-size:16px;\">SMS</span><span style='line-height:107%;font-family:\"Arial\",\"sans-serif\";font-family:\"Arial\",\"sans-serif\";font-size:12.0pt;'>) و/أو البريد الإلكتروني و/أو الهاتف فيما يتعلق بمنتجاتنا وخدماتنا.</span></li>\r\n</ul>\r\n<p style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span dir=\"RTL\" style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>&nbsp;</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>التغييرات على إشعار الخصوصية</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>نحتفظ بالحق في تعديل إشعار الخصوصية هذا في أي وقت. يشير تاريخ نفاذ إشعار الخصوصية، كما هو مذكور أدناه، إلى أحدث تاريخ تمت فيه مراجعة إشعار الخصوصية هذا أو تعديله. يتيح لك التحقق من تاريخ النفاذ أدناه تحديد ما إذا كانت هناك تغييرات منذ آخر مرة قمت فيها بمراجعة إشعار الخصوصية. لذلك، ننصحك بالتحقق بشكل دوري على إشعار الخصوصية هذا لضمان اطلاعك على النسخة المحدثة.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>استخدام ملفات تعريف الارتباط</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>من أجل تحسين تجربة عملائنا، تستخدم مواقعنا الإلكترونية تقنية قياسية تسمى &quot;ملفات تعريف الارتباط&quot; لجمع معلومات حول كيفية استخدام مواقعنا الإلكترونية، والتي قد تتضمن بياناتك. يعد استخدام ملفات تعريف الارتباط أمرًا ضروريًا لتشغيل مواقعنا الإلكترونية.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>اتصل بنا</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>في حالة وجود أي أسئلة، يمكنك التواصل معنا من خلال أي من فروعنا، والبريد الإلكتروني، والمحادثة الفورية، ووسائل التواصل الاجتماعي أو من خلال موقعنا الإلكتروني وتطبيق الهاتف المحمول.</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تاريخ النفاذ</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>تم تعديل هذا الإشعار في ديسمبر&nbsp;</span><span dir=\"LTR\" style=\"font-size:16px;line-height:107%;\">.2022</span></p>\r\n<p dir=\"RTL\" style='margin-top:12.0pt;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><strong><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>إخلاء مسئولية</span></strong></p>\r\n<p dir=\"RTL\" style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;'><span style='font-size:16px;line-height:107%;font-family:\"Arial\",\"sans-serif\";'>لا يهدف إشعار الخصوصية هذا إلى إنشاء أي حقوق تعاقدية من أي نوع أو أي حقوق قانونية أخرى، أو ينشئ أي التزامات علينا فيما يتعلق بأي طرف آخر أو نيابة عن أي طرف. عندما تقوم بتسجيل الدخول إلى مواقع الانترنت الخاصة بأي طرف ثالث، لن يسري إشعار الخصوصية هذا. إضافة إلى ذلك، نحن لسنا مسؤولين عن محتوى مواقع الويب الخاصة بأي طرف ثالث ولا نمثل أي طرف ثالث. لذلك، نوصيك بمراجعة سياسة الخصوصية والأمان لكل رابط تقوم بتسجيل الدخول إليه.</span></p>"
